import React,{useEffect,useState} from "react";
import axios from "axios";

const Multi=(props)=>{
    const[savedTrips,setSaved]=useEffect([])
    useEffect(()=>{
        let controller=new AbortController();
        (async()=>{
            console.log('running')
            const saved=await axios.get((`http://localhost:7000/attractions/${props.signIn}`))
            console.log('response',saved.data)
            controller=null
            setSaved(saved.data)
        })()
        return()=>{
            controller?.abort()
        }
    })
    let content
    if(savedTrips.length){
        content=savedTrips.map((trip)=>{
            return(
                <div style={styling}onClick={()=>props.highlight(i)} className="card" onClick={()=>{props.receiveTrip(trip)}}>
                    <div style={{fontSize:20,fontWeight:7}}className="card-content align">
                        <h1 style={{marginTop:-15}}>{i+1}. {trip.name}</h1> 
                    </div>
                    <div style={{marginLeft:45,marginBottom:5,marginTop:-5}}className="content">
                        <div style={{marginTop:8,marginBottom:5}}>
                            <p>Start: {trip.trip[0].name}</p>
                            <p>End: {trip.trip[trip.trip.length-1].name}</p>
                            <p>Length:{trip.length} Stops</p>
                            <br></br>
                        </div>
                    </div>
                </div>
            )
        })
    }else{
        content=(
            <div className="card center">
                <div className="card-header">
                    <h1>You do not have any saved trips</h1>
                </div>
            </div>
        )
    }

    return(
        <div className="card">
            <div style={{backgroundColor:'gray'}}>
                {content}
            </div>
        </div>
    )
}

export default Multi
